import Footer from '.././Components/Footer';
import ReactPlayer from "react-player"

import './videopage.css'

class Adidas extends Component {
    constructor() {
        super();
        this.state = {
        };
    }


    render() {
        return (
            <div>
                <Header />
                <p>ADIDAS</p>
                <ReactPlayer
                    className='react-player'
                    url='https://vimeo.com/239351268'
                />
                <Footer />
            </div>
        );
    }
}

export default Adidas
